webpackJsonp([0x89132e848a93],{831:function(e,t){e.exports={data:{post:{id:"/home/travis/build/benmvp/benmvp.github.io/content/posts/2015-11-22--little-rock-tech-fest-2015/index.md absPath of file >>> MarkdownRemark",html:'<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/little-rock-tech-fest-2015-banner-4e7ec377fa161bb8e652e8aecaab211d-3165d.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 35.30487804878049%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="Little Rock Tech Fest 2015"\n        title=""\n        src="/static/little-rock-tech-fest-2015-banner-4e7ec377fa161bb8e652e8aecaab211d-48538.png"\n        srcset="/static/little-rock-tech-fest-2015-banner-4e7ec377fa161bb8e652e8aecaab211d-bed0f.png 200w,\n/static/little-rock-tech-fest-2015-banner-4e7ec377fa161bb8e652e8aecaab211d-5fd34.png 400w,\n/static/little-rock-tech-fest-2015-banner-4e7ec377fa161bb8e652e8aecaab211d-48538.png 800w,\n/static/little-rock-tech-fest-2015-banner-4e7ec377fa161bb8e652e8aecaab211d-b70ec.png 1200w,\n/static/little-rock-tech-fest-2015-banner-4e7ec377fa161bb8e652e8aecaab211d-d134a.png 1600w,\n/static/little-rock-tech-fest-2015-banner-4e7ec377fa161bb8e652e8aecaab211d-3165d.png 1640w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Last month on October 16th I had the opportunity to give my first technical talk in a public setting at the <a href="http://lrtechfest.com/">Little Rock Tech Fest 2015</a>. My talk was entitled <em>Sugar &#x26; Spice and Everything nice about ES6</em> and it was based on the <a href="/learning-es6-series/"><em>Learning ES6 series</em></a>.</p>\n<p>I think the talk went well. The audience overall wasn’t particularly JavaScript savvy so it was a challenge to explain improvements to JavaScript with ES6 when folks were unfamiliar with ES3/ES5. There were a handful of knowledgeable folks that got something out of it, however. But it ended up being a blessing because I got great practice and it was a positive learning experience. I learned two main things from the talk:</p>\n<p>First, as much as I want to, I cannot explain the whole world. Even though I had 50 minutes (which feels like a long time) there are 30+ features added to ES6 so there was no way I could even adequately explain half of them. I think I ended up trying to explain half of the features and it was just way too much. Way too much for me and way to much for the audience.</p>\n<p>Second, I realized that when I am explaining how a piece of technology works, the <em>why</em> is just as important (if not more important) than the <em>how</em>. I can explain <em>how</em> destructuring works to the cows come home, but if I don’t properly explain <em>why</em> we as JavaScript developers should use it, most people won’t feel any sense of motivation to learn.</p>\n<p>I just gave a shorter 30-minute version of the talk at Nodevember 2015 where I did focus on the <em>why</em> as well as narrowing the scope of the talk. As a result, it went a whole lot better (for me and the attendees). If you’re looking to learn more about ECMAScript 6, I would suggest watching that video instead. However, if you want to see the Little Rock Tech Fest video, here you go!</p>\n<div>\n          <div\n            class="gatsby-resp-iframe-wrapper"\n            style="padding-bottom: 56.08465608465608%; position: relative; height: 0; overflow: hidden;margin-bottom: 2em"\n          >\n            <iframe src="//player.vimeo.com/video/142865720" style="\n            position: absolute;\n            top: 0;\n            left: 0;\n            width: 100%;\n            height: 100%;\n          " frameborder="0" webkitallowfullscreen="" mozallowfullscreen="" allowfullscreen></iframe>\n          </div>\n          </div>\n<p>You can find the PDF slides here: <a href="https://drive.google.com/file/d/0B3vWDhvtt22UNW9qQzlNb09JRDA/view">https://drive.google.com/file/d/0B3vWDhvtt22UNW9qQzlNb09JRDA/view</a></p>\n<p>Hopefully this will be the first of many, many more to come!</p>',fields:{slug:"/little-rock-tech-fest-2015/",prefix:"2015-11-22"},frontmatter:{title:"Little Rock Tech Fest 2015",subTitle:null,cover:{childImageSharp:{resize:{src:"/static/little-rock-tech-fest-2015-banner-4e7ec377fa161bb8e652e8aecaab211d-160fa.png"}}}}},author:{id:"/home/travis/build/benmvp/benmvp.github.io/content/parts/author.md absPath of file >>> MarkdownRemark",html:'<p>Ben is a Christian, husband and father of 2 girls, with a dozen years of experience developing user interfaces for the Web. He currently is a Principal Frontend Engineer at Eventbrite on the Frontend Platform team, focused on improving their React-based design system and frontend infrastructure. Ben also enjoys playing basketball, DIY, watching movies, and <a href="https://twitter.com/benmvp">tweeting</a> / <a href="http://www.benmvp.com">blogging</a> about his experiences with new web technologies.</p>'},footnote:{id:"/home/travis/build/benmvp/benmvp.github.io/content/parts/footnote.md absPath of file >>> MarkdownRemark",html:'<ul>\n<li>© Ben Ilegbodu 2018.</li>\n<li>Powered by <a href="https://www.gatsbyjs.org/">Gatsby</a> &#x26; <a href="https://reactjs.org">React</a> using <a href="https://github.com/greglobinski/gatsby-starter-personal-blog">gatsby-starter-personal-blog</a>.</li>\n</ul>'}},pathContext:{slug:"/little-rock-tech-fest-2015/"}}}});
